  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Target
  Rock National Wildlife Refuge outlines Refuge accomplishments during the 1983 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses the master plan. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  and safety is given. Habitat management is also covered; subjects include wetlands,
  forests, other habitats, and fire management. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, other migratory
  birds, and game mammals. The public uses of the Refuge described in this report
  include outdoor classrooms, interpretive programs, fishing, wildlife observation,
  picnicking, and law enforcement. The equipment and facilities section of the report
  provides information about rehabilitation, major maintenance, equipment utilization
  and replacement, and energy conservation. Items of interest are provided at the
  end. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
